//const float32_t theta1_lim_rad[] = {-M_PI_2, M_PI};
const float32_t theta1_lim_rad[] = {-M_PI_2 - M_PI_6 , M_PI_2};
//const float32_t theta2_lim_rad[] = {0, M_PI};
const float32_t theta2_lim_rad[] = {0, M_PI_2 + M_PI_6};

arm_bilinear_interp_instance_f32 S_trq1 = {NUM_ROWS, NUM_COLS, trq1_lut};
arm_bilinear_interp_instance_f32 S_trq2 = {NUM_ROWS, NUM_COLS, trq2_lut};

void getJointTorque(const float32_t theta_rad[], float32_t torque_Nm[])
{
   // X: col: theta2 (from 0 to pi)
   // Y: row: theta1 (from -pi/2 to pi)

   float32_t x = (theta_rad[1] - theta2_lim_rad[0])/(theta2_lim_rad[1] - theta2_lim_rad[0])*(NUM_COLS - 1);
   float32_t y = (theta_rad[0] - theta1_lim_rad[0])/(theta1_lim_rad[1] - theta1_lim_rad[0])*(NUM_ROWS - 1);   
   
   torque_Nm[0] = arm_bilinear_interp_f32(&S_trq1, fmax(fmin(x,NUM_COLS),0), fmax(fmin(y,NUM_ROWS),0));
   torque_Nm[1] = arm_bilinear_interp_f32(&S_trq2, fmax(fmin(x,NUM_COLS),0), fmax(fmin(y,NUM_ROWS),0));
}